import React from "react";
import PopupWithForm from "./PopupWithForm";

function DeleteCardPopup({ isOpen, onClose, onDeleteCard, card }) {
  function handleDeleteCard() {
    onDeleteCard(card);
  }

  return (
    <PopupWithForm
      isOpen={isOpen}
      onClose={onClose}
      name={"delete-card"}
      title={"Вы уверены?"}
      buttonName={"Да"}
      onSubmit={handleDeleteCard}
    />
  );
}

export default DeleteCardPopup;
